script: |
  super -f text -I q5296.spq | sort > q5296.out

inputs:
  - name: q5296.spq
    data: |
      SELECT ALL col1 + + col0 + col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE - col2 * + col1 <= cor0.col0 * col1 OR NOT col0 NOT BETWEEN NULL AND + col0 * + col0 + col0;
  - name: tab1

outputs:
  - name: q5296.out
    data: |
      106
      55
      84
